"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[2066],{25454:e=>{e.exports=JSON.parse('{"blogPosts":[{"id":"release-2023-01-23","metadata":{"permalink":"/release-notes/release-2023-01-23","source":"@site/blog/2024-01-15/2024-01-23.md","title":"2024.01.23","description":"Introduction","date":"2024-01-23T00:00:00.000Z","formattedDate":"January 23, 2024","tags":[{"label":"SSO","permalink":"/release-notes/tags/sso"},{"label":"Reporting","permalink":"/release-notes/tags/reporting"}],"readingTime":1.055,"hasTruncateMarker":false,"authors":[{"name":"Leon Meier","title":"Head of Product","email":"leon.meier@askui.com","imageURL":"/img/leonmeier.jpeg","key":"leonmeier"}],"frontMatter":{"title":"2024.01.23","slug":"release-2023-01-23","authors":["leonmeier"],"tags":["SSO","Reporting"],"hide_table_of_contents":false},"unlisted":false,"nextItem":{"title":"2023.12.13","permalink":"/release-notes/release-2023-12-13"}},"content":"## Introduction\\n\\nWe\'re introducing two significant enhancements to our platform: Single Sign-On (SSO) Integration for various identity providers and the AskUIXRayStepReporter for automation workflows in Xray for Jira. These features are designed to streamline the authentication process and improve test reporting, respectively.\\n\\n### Overview of Features\\n\\n1. **Single Sign-On Integration**\\n   - **Documentation**: [SSO Setup Guide](https://docs.askui.com/docs/general/Integrations/sso)\\n   - This feature allows seamless integration with various identity providers including Azure AD, Google Workspace, and Okta, enhancing security and simplifying user management.\\n\\n2. **AskUIXRayStepReporter**\\n   - **Documentation**: [AskUIXRayStepReporter Guide](https://docs.askui.com/docs/general/Integrations/reporting#askuixraystepreporter)\\n   - This feature integrates with Xray for Jira to provide detailed reporting of automation workflows, including screenshots and test statuses.\\n\\n### Detailed Descriptions\\n\\n#### Single Sign-On Integration\\n\\nOur new SSO Integration feature supports a wide range of identity providers. It offers enhanced security, unified login experiences, and streamlined user account management, significantly reducing the overhead of managing separate login credentials.\\n\\n#### AskUIXRayStepReporter\\n\\nThe AskUIXRayStepReporter is a powerful tool for reporting test automation results directly to Xray for Jira. It helps teams maintain comprehensive documentation of their test executions, complete with visual evidence and detailed status reports.\\n\\n---\\n\\nWe are excited to see how these new features will enhance your experience with our platform, providing greater convenience, security, and efficiency in your automated testing and user management processes."},{"id":"release-2023-12-13","metadata":{"permalink":"/release-notes/release-2023-12-13","source":"@site/blog/2023-12-13/annotate-detected-elements.md","title":"2023.12.13","description":"Introduction","date":"2023-12-13T00:00:00.000Z","formattedDate":"December 13, 2023","tags":[{"label":"Selection","permalink":"/release-notes/tags/selection"},{"label":"Annotation","permalink":"/release-notes/tags/annotation"}],"readingTime":0.7,"hasTruncateMarker":false,"authors":[{"name":"Leon Meier","title":"Head of Product","email":"leon.meier@askui.com","imageURL":"/img/leonmeier.jpeg","key":"leonmeier"}],"frontMatter":{"title":"2023.12.13","slug":"release-2023-12-13","authors":["leonmeier"],"tags":["Selection","Annotation"],"hide_table_of_contents":false},"unlisted":false,"prevItem":{"title":"2024.01.23","permalink":"/release-notes/release-2023-01-23"}},"content":"## Introduction\\n\\nOn December 13, we introduced three new features: the **Visual Description Matching Method** for selecting diverse visual elements, **Targeted Annotations** for precise debugging, and **Precision Text Matching** for flexible text matching.\\n\\n## Overview\\n\\n1. **Visual Description Matching Method**\\n   - **Documentation**: [Matching Feature](https://docs.askui.com/docs/api/Element-Descriptions/matching)\\n   - This feature introduces the `matching()`method, allowing users to identify and interact with UI elements based solely on textual descriptions.\\n   - Enhances the flexibility of automated interactions with dynamic UIs.\\n\\n2. **Targeted Annotations**\\n   - **Documentation**: [Annotate DetectedElements](https://docs.askui.com/docs/api/Annotation/annotate)\\n   - Introduces an `AnnotationRequest` parameter in the `annotate()` method, allowing users to annotate specific elements retrieved from user interfaces by the `get()` method.\\n   - Simplifies debugging of UI element selection.\\n\\n3. **Precision Text Matching**\\n   - **Documentation**: [Adjustable Similarity Score](https://docs.askui.com/docs/api/Element-Descriptions/withtext)\\n   - Introduces an optional `similarity_score` parameter for the `.withText()` method.\\n   - Improves script resilience and minimizes mismatches in text-based automation."}]}')}}]);